import React from "react";
import Item from "./Items";

export default function List({
  blocktext,
  id,
}) {
  return (
    <div>
      <h1>ISODHAOI</h1>
      {blocktext.forEach((v) => (
        <Item text={'hello'}/>
      ))}
      <button class="end">
        + Add a card
      </button>
    </div>
  );
}
